// src/App.js
import React from 'react';
import { Provider } from 'react-redux';
import { createStore } from 'redux';
import rootReducer from './redux/rootReducer'; // Импортируйте корневой редюсер
import ServiceDetails from './components/ServiceDetails'; // Импортируйте Ваш компонент

const store = createStore(rootReducer);

const App = () => {
  return (
    <Provider store={store}>
      <ServiceDetails />
    </Provider>
  );
};

export default App;
